import PropTypes from 'prop-types';

const Item =(props)=>{
    const {name,tel} = props
    if( name.startsWith("นาง")) {
        console.log("ผู้หญิง");
    }else if( name.startsWith("นาย")) {
        console.log("ผู้ชาย");
    }else{
        console.log("อื่นๆ");
    }
    return <li>{name}<span>{tel}</span></li>
}

Item.propType={
    name:PropTypes.string,
    tel:PropTypes.string
}
export default Item
